'use strict';

var question = document.querySelector('#question');
var answer = document.querySelector('#input_message');
var input_btn = document.querySelector('#input_btn');
var next_btn = document.querySelector('#next_btn');
var result = document.querySelector('#result');
var resultScore = document.querySelector('#score');
var currentNum = 0;
var score = 0; // クイズをセットする

function setQuiz() {
  if (answer.disabled) {
    answer.disabled = false;
  }

  if (next_btn.classList.contains('active')) {
    next_btn.classList.remove('active');
  }

  if (answer.classList.contains('correct')) {
    answer.classList.remove('correct');
  } else if (answer.classList.contains('wrong')) {
    answer.classList.remove('wrong');
  }

  result.classList.add('hidden');
  input_btn.classList.remove('check_answer'); //btnのcheck_answerクラスを削除

  next_btn.classList.add('disabled'); //next_btnにdisabledクラスを追加

  question.textContent = quizList[currentNum].q; //問題文のセット
} // 問題文をシャッフルする


function shuffle(arr) {
  for (var i = quizList.length - 1; i > 0; i--) {
    var j = Math.floor(Math.random() * quizList.length);
    var _ref = [arr[j], arr[i]];
    arr[i] = _ref[0];
    arr[j] = _ref[1];
  }

  return arr;
}

shuffle(quizList);
setQuiz(); //inputに答えを入力するとbtnの色が変化する

function btnColor() {
  if (answer.value.length === 0) {
    //入力されていなければbtnの色は変更しない
    input_btn.classList.remove('check_answer');
  } else if (answer.value.length >= 1) {
    //1文字でも入力されていればbtnの色を変更
    input_btn.classList.add('check_answer');
  }
} // 答え合わせ


function check_answer() {
  answer.disabled = true;
  var checked_ans = quizList[currentNum].a.find(function (e) {
    return e.test(answer.value);
  });

  if (checked_ans) {
    answer.classList.add('correct');
    input_btn.classList.add('correct');
    input_btn.value = '◯';
    score++;
    resultScore.textContent = "Score : ".concat(score, " / ").concat(quizList.length);
  } else {
    answer.classList.add('wrong');
    input_btn.classList.add('wrong');
    input_btn.value = '×';
  }

  input_btn.classList.remove('check_answer');
} //input_btnを押すと答え合わせをする


input_btn.addEventListener('click', function () {
  if (input_btn.classList.contains('check_answer')) {
    check_answer();
    next_btn.classList.remove('disabled');
    next_btn.classList.add('active');
  }
}); // input['text']の入力を監視

answer.addEventListener('input', function () {
  btnColor();
}); // next_btnを押すと問題を進める

next_btn.addEventListener('click', function () {
  if (next_btn.classList.contains('disabled')) {
    return;
  } else if (currentNum < quizList.length - 1) {
    //最後の問題まで進める
    currentNum++; //問題を1つ進める

    answer.value = ''; //inputの中を初期化する  

    input_btn.value = '答え合わせ';

    if (input_btn.classList.contains('correct')) {
      input_btn.classList.remove('correct');
    } else if (input_btn.classList.contains('wrong')) {
      input_btn.classList.remove('wrong');
    }
  }

  if (currentNum === quizList.length - 1) {
    //最後の問題でnext_btnの表示を変える
    next_btn.textContent = '結果発表！';
    next_btn.addEventListener('click', function () {
      result.classList.remove('hidden');
    });
  }

  setQuiz();
});
